import React from 'react';
import { NavLink } from 'react-router-dom';

export const Nav = () => {
    return (
        <nav>
            <NavLink to='/' activeClassName='active-link'>Home</NavLink>
            <a href='https://www.hardlyart.com/artists/chastity_belt' target='_blank'>About</a>
            <NavLink to='/shows' activeClassName='active-link'>Shows</NavLink>
            <NavLink to='/music' activeClassName='active-link'>Music</NavLink>
            <a href='http://chastitybelt.limitedrun.com/store' target='_blank'>Shop
            </a>
            <NavLink to='/fan-art' activeClassName='active-link'>Fan Art</NavLink>
            <NavLink to='/contact' activeClassName='active-link'>Contact</NavLink>
        </nav>
    );
};
